import ProductCategory from "./ProductCategory";
import ProductItems from "./ProductItems";

export default function ProductList(props) {
  return (
    <div>
      <header>
        <p>Name</p>
        <p>Price</p>
      </header>
      <ProductCategory category={props} />
      <ProductItems products={props.products} />
    </div>
  );
}
